const config = {
  "previewFeatures": [],
  "clientVersion": "7.3.0",
  "engineVersion": "9d6ad21cbbceab97458517b147a6a09ff43aa735",
  "activeProvider": "postgresql",
  "inlineSchema": "// Prisma schema for SaaS Multi-Tenant WhatsApp CRM/ERP\n// Modelagem: Usuários, Empresas, Instâncias WhatsApp, Produtos, Kanban, Agendamentos, Permissões, Histórico IA\n\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n}\n\nmodel Tenant {\n  id   String @id @default(uuid())\n  name String\n  slug String @unique\n\n  operationMode   VendorMode @default(SELLER)\n  vendorPhone     String?\n  enableInvoices  Boolean    @default(false)\n  invoiceTemplate String?\n\n  apiKeys               ApiKey[]\n  users                 User[]\n  whatsapp              WhatsAppInstance[]\n  products              Product[]\n  kanban                KanbanBoard[]\n  schedules             Schedule[]\n  contacts              Contact[]\n  quickReplies          QuickReply[]\n  iaHistories           IAHistory[]\n  wordPressIntegrations WordPressIntegration[]\n  wordPressProducts     WordPressProduct[]\n  orders                Order[]\n  whatsappConfig        TenantWhatsAppConfig?\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\nmodel ApiKey {\n  id        String     @id @default(uuid())\n  tenant    Tenant     @relation(fields: [tenantId], references: [id])\n  tenantId  String\n  type      ApiKeyType\n  key       String\n  createdAt DateTime   @default(now())\n}\n\nenum ApiKeyType {\n  OPENAI\n  GEMINI\n}\n\nmodel User {\n  id                    String     @id @default(uuid())\n  tenant                Tenant     @relation(fields: [tenantId], references: [id])\n  tenantId              String\n  email                 String\n  name                  String\n  phone                 String?\n  password              String\n  role                  UserRole   @default(CUSTOMER)\n  status                UserStatus @default(PENDING_ONBOARDING)\n  onboardingCompletedAt DateTime?\n\n  preferences  UserPreferences?\n  iaHistories  IAHistory[]\n  vendorOrders Order[]          @relation(\"vendor_orders\")\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([tenantId, email])\n  @@index([tenantId])\n}\n\nenum UserRole {\n  SUPERADMIN\n  ADMIN\n  AGENT\n  VIEWER\n  VENDOR\n  ATTENDANT\n  CUSTOMER\n}\n\nenum UserStatus {\n  PENDING_ONBOARDING\n  ACTIVE\n  INACTIVE\n  SUSPENDED\n}\n\nenum VendorMode {\n  SELLER\n  SERVICE\n  SUPPORT\n}\n\nmodel WhatsAppInstance {\n  id          String    @id @default(uuid())\n  tenant      Tenant    @relation(fields: [tenantId], references: [id])\n  tenantId    String\n  name        String\n  instanceKey String    @unique\n  status      String\n  chats       Chat[]\n  contacts    Contact[]\n  createdAt   DateTime  @default(now())\n  updatedAt   DateTime  @updatedAt\n}\n\nmodel Chat {\n  id            String           @id @default(uuid())\n  whatsapp      WhatsAppInstance @relation(fields: [whatsappId], references: [id])\n  whatsappId    String\n  contact       Contact          @relation(fields: [contactId], references: [id])\n  contactId     String\n  messages      Message[]\n  orders        Order[]\n  audioMessages AudioMessage[]\n  createdAt     DateTime         @default(now())\n  updatedAt     DateTime         @updatedAt\n  iaHistories   IAHistory[]\n}\n\nmodel Contact {\n  id         String           @id @default(uuid())\n  tenant     Tenant           @relation(fields: [tenantId], references: [id])\n  tenantId   String\n  whatsapp   WhatsAppInstance @relation(fields: [whatsappId], references: [id])\n  whatsappId String\n\n  name          String\n  phone         String\n  email         String?\n  chats         Chat[]\n  kanban        KanbanCard[]\n  orders        Order[]\n  audioMessages AudioMessage[]\n  createdAt     DateTime       @default(now())\n  updatedAt     DateTime       @updatedAt\n\n  @@index([tenantId])\n  @@index([phone])\n}\n\nmodel Message {\n  id        String      @id @default(uuid())\n  chat      Chat        @relation(fields: [chatId], references: [id])\n  chatId    String\n  sender    String\n  content   String\n  type      MessageType\n  createdAt DateTime    @default(now())\n}\n\nenum MessageType {\n  USER\n  BOT\n  SYSTEM\n}\n\nmodel Product {\n  id        String   @id @default(uuid())\n  tenant    Tenant   @relation(fields: [tenantId], references: [id])\n  tenantId  String\n  name      String\n  category  String\n  price     Float?\n  url       String?\n  stock     Int?\n  metadata  Json?\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\nmodel KanbanBoard {\n  id        String        @id @default(uuid())\n  tenant    Tenant        @relation(fields: [tenantId], references: [id])\n  tenantId  String\n  name      String\n  stages    KanbanStage[]\n  createdAt DateTime      @default(now())\n}\n\nmodel KanbanStage {\n  id      String       @id @default(uuid())\n  board   KanbanBoard  @relation(fields: [boardId], references: [id])\n  boardId String\n  name    String\n  order   Int\n  cards   KanbanCard[]\n}\n\nmodel KanbanCard {\n  id          String      @id @default(uuid())\n  stage       KanbanStage @relation(fields: [stageId], references: [id])\n  stageId     String\n  contact     Contact     @relation(fields: [contactId], references: [id])\n  contactId   String\n  title       String\n  description String?\n  order       Int\n  createdAt   DateTime    @default(now())\n}\n\nmodel Schedule {\n  id        String         @id @default(uuid())\n  tenant    Tenant         @relation(fields: [tenantId], references: [id])\n  tenantId  String\n  name      String\n  type      ScheduleType\n  target    String\n  payload   Json\n  runAt     DateTime\n  status    ScheduleStatus\n  createdAt DateTime       @default(now())\n}\n\nenum ScheduleType {\n  DRIP\n  MASS\n}\n\nenum ScheduleStatus {\n  PENDING\n  RUNNING\n  COMPLETED\n  FAILED\n}\n\nmodel QuickReply {\n  id        String   @id @default(uuid())\n  tenant    Tenant   @relation(fields: [tenantId], references: [id])\n  tenantId  String\n  label     String\n  content   String\n  createdAt DateTime @default(now())\n}\n\nmodel IAHistory {\n  id        String     @id @default(uuid())\n  tenant    Tenant     @relation(fields: [tenantId], references: [id])\n  tenantId  String\n  user      User?      @relation(fields: [userId], references: [id])\n  userId    String?\n  chat      Chat?      @relation(fields: [chatId], references: [id])\n  chatId    String?\n  prompt    String\n  response  String\n  source    IAProvider\n  createdAt DateTime   @default(now())\n}\n\nenum IAProvider {\n  OPENAI\n  GEMINI\n  OLLAMA\n}\n\nmodel WordPressIntegration {\n  id          String  @id @default(uuid())\n  tenant      Tenant  @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  tenantId    String\n  siteUrl     String // https://exemplo.com.br\n  apiUrl      String // https://exemplo.com.br/wp-json/wp/v2\n  username    String? // Para autenticação básica\n  appPassword String? // Gerado no WordPress\n  isActive    Boolean @default(true)\n\n  // Configuração de campos sincronizados\n  syncProducts Boolean @default(true)\n  syncPosts    Boolean @default(false)\n  syncPages    Boolean @default(false)\n\n  // Campos a sincronizar de produtos\n  productFields String @default(\"id,name,description,price,images,categories,attributes\") // JSON array\n\n  lastSyncedAt  DateTime?\n  syncFrequency Int       @default(3600) // segundos (1 hora)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([tenantId, siteUrl])\n  @@index([tenantId])\n}\n\nmodel WordPressProduct {\n  id              String  @id @default(uuid())\n  tenant          Tenant  @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  tenantId        String\n  wpProductId     Int // ID do produto no WordPress\n  name            String\n  slug            String\n  description     String? @db.Text\n  longDescription String? @db.Text\n  price           Float?\n  regularPrice    Float?\n  salePrice       Float?\n  image           String? // URL da imagem principal\n  images          String? @db.Text // JSON array de URLs\n  categories      String? // JSON array de categorias\n  tags            String? // JSON array de tags\n  attributes      Json? // Campos personalizados do WP\n  stock           Int?\n  status          String? // publish, draft, etc\n\n  // Para busca de contexto na IA\n  syncedAt  DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([tenantId, wpProductId])\n  @@index([tenantId])\n  @@index([name])\n}\n\n// ============= NOVA FASE 1: MODELS DE PEDIDOS, ÁUDIO, PAGAMENTO =============\n\nmodel UserPreferences {\n  id     String @id @default(uuid())\n  userId String @db.Uuid\n  user   User   @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  operationMode VendorMode @default(SELLER)\n  audioEnabled  Boolean    @default(true)\n  audioLanguage String     @default(\"pt-BR\")\n  audioSpeed    Float      @default(1.0)\n\n  language String @default(\"pt-BR\")\n  timezone String @default(\"America/Sao_Paulo\")\n\n  notificationEmail    Boolean @default(true)\n  notificationSMS      Boolean @default(false)\n  notificationsEnabled Boolean @default(true)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([userId])\n}\n\nenum OrderStatus {\n  DRAFT\n  CONFIRMED\n  PENDING_PAYMENT\n  PAID\n  PROCESSING\n  SHIPPED\n  DELIVERED\n  CANCELLED\n}\n\nenum PaymentStatus {\n  PENDING\n  PROCESSING\n  PAID\n  FAILED\n  REFUNDED\n}\n\nmodel Order {\n  id       String @id @default(uuid())\n  tenantId String @db.Uuid\n  tenant   Tenant @relation(fields: [tenantId], references: [id])\n\n  chatId String @db.Uuid\n  chat   Chat   @relation(fields: [chatId], references: [id])\n\n  contactId String  @db.Uuid\n  contact   Contact @relation(fields: [contactId], references: [id])\n\n  vendorId String? @db.Uuid\n  vendor   User?   @relation(\"vendor_orders\", fields: [vendorId], references: [id])\n\n  status        OrderStatus   @default(DRAFT)\n  paymentStatus PaymentStatus @default(PENDING)\n  paymentMethod String?\n  paymentProof  PaymentProof?\n\n  sentToVendor      Boolean   @default(false)\n  sentToVendorAt    DateTime?\n  vendorOrderNumber String?\n  invoiceUrl        String?\n  invoiceData       Json?\n\n  items OrderItem[]\n\n  subtotal Decimal @default(0)\n  tax      Decimal @default(0)\n  discount Decimal @default(0)\n  total    Decimal @default(0)\n\n  notes String?\n\n  createdAt   DateTime  @default(now())\n  updatedAt   DateTime  @updatedAt\n  confirmedAt DateTime?\n\n  @@index([tenantId, paymentStatus])\n  @@index([chatId])\n  @@index([vendorId])\n}\n\nmodel OrderItem {\n  id      String @id @default(uuid())\n  orderId String @db.Uuid\n  order   Order  @relation(fields: [orderId], references: [id], onDelete: Cascade)\n\n  productSource   String\n  productSourceId String?\n  productName     String\n\n  unitPrice Decimal\n  quantity  Int\n  subtotal  Decimal\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([orderId])\n}\n\nmodel PaymentProof {\n  id      String @id @default(uuid())\n  orderId String @db.Uuid\n  order   Order  @relation(fields: [orderId], references: [id], onDelete: Cascade)\n\n  proofType String\n  proofUrl  String\n  proofData Json?\n\n  isVerified        Boolean   @default(false)\n  verifiedBy        String?\n  verifiedAt        DateTime?\n  verificationNotes String?\n\n  uploadedAt DateTime @default(now())\n\n  @@unique([orderId])\n}\n\nenum AudioStatus {\n  RECEIVED\n  CONVERTING\n  TRANSCRIBED\n  TRANSCRIPTION_FAILED\n  PROCESSING_ERROR\n  PROCESSED\n}\n\nmodel AudioMessage {\n  id String @id @default(uuid())\n\n  chatId String @db.Uuid\n  chat   Chat   @relation(fields: [chatId], references: [id])\n\n  contactId String  @db.Uuid\n  contact   Contact @relation(fields: [contactId], references: [id])\n\n  audioPath String\n  mimeType  String\n  sizeBytes Int\n  duration  Int\n\n  status AudioStatus @default(RECEIVED)\n\n  transcript           String?\n  transcriptConfidence Float?\n  transcribedAt        DateTime?\n  transcriptionTimeMs  Int?\n\n  errorMessage String?\n\n  createdAt DateTime @default(now())\n\n  @@index([chatId])\n}\n\nmodel TTSCache {\n  id String @id @default(uuid())\n\n  textHash String\n  language String\n\n  audioPath    String\n  audioUrl     String\n  audioFormat  String?\n  duration     Int\n  originalText String?\n  voice        String?\n  hitCount     Int      @default(0)\n  createdAt    DateTime @default(now())\n\n  provider    String\n  generatedAt DateTime @default(now())\n  expiresAt   DateTime\n\n  @@unique([textHash, language])\n  @@index([language, expiresAt])\n}\n\nmodel TenantWhatsAppConfig {\n  id       String @id @default(uuid())\n  tenantId String @db.Uuid\n  tenant   Tenant @relation(fields: [tenantId], references: [id])\n\n  vendorPhoneNumber String\n  vendorPhoneName   String?\n  vendorInstanceKey String?\n\n  autoSendOrder       Boolean @default(true)\n  includePaymentProof Boolean @default(true)\n  invoiceTemplate     String?\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([tenantId])\n}\n"
}

